import Header from "../components/Header";
import Footer from "../components/Footer";

const Contact = ({ footerStyle }) => {
  return (
    <>
      <section style={footerStyle} className="contact-body">
        <Header />
        <h1
          style={{
            color: "white",
            textAlign: "center",
            marginTop: "2rem",
            fontSize: "44px",
          }}
        >
          Contact Page Under Construction..
        </h1>
      </section>
      <Footer />
    </>
  );
};

export default Contact;
